import React from "react";
import "./Confirm.css";
import print1 from "../../img/print1.png";
import { Button } from "@mantine/core";

const Confirm = () => {
  return (
    <div className="Confirm">
      <div className="confirm-lang-background"></div>
      <div className="top-text">You have selected</div>
      <div className="card-view"></div>
      <div className="top-text">10 ml</div>
      <div className="top-text">rs. 5</div>
      <div className="top-text">Best before 4 months from purchase date</div>
      <div className="btn-bottom">
        <Link to="/Product">
          <div className="btn-decline">
            <Button>
              <span className="p">DECLINE</span>
            </Button>
          </div>
        </Link>
        <div className="btn-confirm">
          <Button>
            <span className="p">CONFIRM</span>
          </Button>
        </div>
      </div>
    </div>
  );
};

export default Confirm;
